package a00_batch12;

public class a05_Increment_or_Decrement_operator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		// Increment operator(++)
		int a=10;
		System.out.println(a++);
		System.out.println(a);
		System.out.println(++a);
		
		//Decrement operator(--)
		System.out.println(a--);
		System.out.println(a);
		System.out.println(--a);
	}

}
